uint64_t rl_agent(double wire_bw, double buffers, double remaining_bytes, double pacer_period)
{

    double scaled_bw = wire_bw * bw_scale + bw_min;
    double scaled_buffers = buffers * buff_scale + buff_min;
    double scaled_remaining_bytes = remaining_bytes * remaining_bytes_scale + remaining_bytes_min;
    double scaled_period = pacer_period * period_scale + period_min;

    // feature range
    // scaled_bw = MAX(MIN(scaled_bw, 1), -1);
    // scaled_buffers = MAX(MIN(scaled_buffers, 1), -1);
    // scaled_period = MAX(MIN(scaled_period, 1), -1);

    double new_state[input_dim] = {scaled_bw , scaled_buffers, scaled_remaining_bytes, scaled_period, prev_action};

    roll(state_history, new_state);

    // return minimum possible period
    if (buffers == 0)
    {
        prev_action = 0;
        return (uint64_t)round(pacer_period);
    }

    uint64_t new_period;

    // print_state_history(state_history);
    double action = mlp(state_history);
    double unscaled_action = action*action_scale + action_mean;

    // SPDK_NOTICELOG(" actual action: %f actual unscaled action: %f scaled_bw: %f, scaled_buffers: %f, scaled_period:%f \n", action, unscaled_action, scaled_bw, scaled_buffers, scaled_period);
    new_period = (uint64_t)round(pacer_period + unscaled_action);
    new_period = MIN(MAX(new_period, MIN_PERIOD), MAX_PERIOD);
    // action
    // unscaled_action = (double)new_period - pacer_period;
    // // re-scale action
    // action = (unscaled_action - action_mean) / action_scale;


    SPDK_NOTICELOG("state - new_period: %lu, period: %f, buffers: %f, remaining_bytes: %f, wire_bw: %f, prev_action: %f, action: %f, unscaled_action: %f\n", new_period, pacer_period, buffers, remaining_bytes, wire_bw, prev_action, action, unscaled_action);

    prev_action = action;
    return new_period;
}